
const image64 = `
data:image/jpeg;base64,
`
// data:image/jpeg;base64,
// data:image/png;base64,

ww = window.innerWidth, wh = window.innerHeight;

let centerVector = new THREE.Vector3(0, 0, 0);
let previousTime = 0;
const speedDot = 100;
let isMouseDown = false;
const speedCam = 45 / 1000;

let getImageData = function (image) {

    let canvas = document.createElement("canvas");
    canvas.width = image.width;
    canvas.height = image.height;

    let ctx = canvas.getContext("2d");
    ctx.drawImage(image, 0, 0);

    return ctx.getImageData(0, 0, image.width, image.height);
};

function getPixel(imagedata, x, y) {
    const position = (x + imagedata.width * y) * 4;
    const data = imagedata.data;

    return { r: data[position], g: data[position + 1], b: data[position + 2], a: data[position + 3] };
}

let drawTheMap = function () {

    let geometry = new THREE.Geometry();
    let material = new THREE.PointCloudMaterial();

    material.vertexColors = true;
    material.transparent = true;
    material.size = 1;

    for (let y = 0, y2 = imagedata.height; y < y2; y += 1) {
        for (let x = 0, x2 = imagedata.width; x < x2; x += 1) {

            const vertex = new THREE.Vector3();
            vertex.x = x - imagedata.width / 2 + (500);
            vertex.y = -y + imagedata.height / 2;
            vertex.z = -Math.random() * 1500;
            vertex.speed = Math.random() / speedDot + 0.015;
            const pixelColor = getPixel(imagedata, x, y);
            const color = "rgb(" + pixelColor.r + ", " + pixelColor.g + ", " + pixelColor.b + ")";

            if (
                pixelColor.r > 50 ||
                pixelColor.g > 50 ||
                pixelColor.b > 50
            ) {
                geometry.colors.push(new THREE.Color(color));
                geometry.vertices.push(vertex);
            }


        }
    }

    particles = new THREE.Points(geometry, material);

    console.log(particles);
    scene.add(particles);

    requestAnimationFrame(render);
};

let init = function () {
    renderer = new THREE.WebGLRenderer({
        canvas: document.getElementById("yahia"),
        antialias: true,
        alpha: true
    });
    renderer.setSize(ww, wh);

    scene = new THREE.Scene();

    // OrthographicCamera( left : Number, right : Number, top : Number, bottom : Number, near : Number, far : Number )
    camera = new THREE.OrthographicCamera(ww / -2, ww / 2, wh / 2, wh / -2, 1, 1000);
    console.log(camera);

    camera.position.set(0, -10, 14);
    camera.lookAt(centerVector);
    scene.add(camera);
    camera.zoom = 1;
    camera.updateProjectionMatrix();

    imagedata = getImageData(image);
    drawTheMap();

    window.addEventListener('mousemove', onMousemove, false);
    window.addEventListener('mousedown', onMousedown, false);
    window.addEventListener('mouseup', onMouseup, false);
    window.addEventListener('resize', onResize, false);
};
let onResize = function () {
    ww = window.innerWidth;
    wh = window.innerHeight;
    renderer.setSize(ww, wh);
    camera.left = ww / -2;
    camera.right = ww / 2;
    camera.top = wh / 2;
    camera.bottom = wh / -2;
    camera.updateProjectionMatrix();
};

let onMouseup = function () {
    isMouseDown = false;
};
let onMousedown = function (e) {
    isMouseDown = true;
    lastMousePos = { x: e.clientX, y: e.clientY };
};
let onMousemove = function (e) {
    if (isMouseDown) {
        camera.position.x += (e.clientX - lastMousePos.x) / 100;
        camera.position.y -= (e.clientY - lastMousePos.y) / 100;
        camera.lookAt(centerVector);
        lastMousePos = { x: e.clientX, y: e.clientY };
    }
};

let render = function (a) {
    particles.geometry.verticesNeedUpdate = true;
    if (!isMouseDown) {
        camera.position.x += (0 - camera.position.x) * speedCam;
        camera.position.y += (0 - camera.position.y) * speedCam;
        camera.lookAt(centerVector);
    }
    renderer.render(scene, camera);

    requestAnimationFrame(render);
};

let imgData = image64;
let image = document.createElement("img");
image.src = imgData;

init();